prog:
// 
// Welcome to Game Lab!
//
// Game Lab is a tool for learning how to code by making video games.
// Playing around with existing code is a great way to learn how
// Game Lab works.
//
// See the play button in the top right? It looks like a black triangle.
// Hit that to get started!
//
// CHALLENGE 1: Help! The knight can't jump high enough to reach the gold coin!
//              Click on the knight to focus the game screen.
//              Press the space bar to make the knight jump.
//
//              Read through the code below and try changing the numbers to make
//              the knight jump higher.
//

const e = createEngine(gameCanvas, 334, 270);

/* BEGIN TEXT */
e.addText("poor guy can't", 77, 52);
e.addText("reach the coin!", 77, 52 + 16);

e.addText("his armor must", 265, 52);
e.addText("be too heavy!", 266, 52 + 16)

e.addText("change the code to make him jump higher?", 169, 119);
/* END TEXT */

/* BEGIN PLAYER */
let jumps = 1;
e.add({
  sprite: knight,
  solid: true,
  scale: 3,
  x: 120,
  y: 138,
  collides() {
    jumps = 1;
  },
  update(me) {
    /* JUMPING */
    if (e.pressedKey(" ") && jumps == 1) {
      jumps = 0;
      me.vy = -200;
    }

    /* GRAVITY */
    me.vy += 10
  }
})
/* END PLAYER */

/* BEGIN COIN */
e.add({
  sprite: coin,
  scale: 4,
  x: 139, 
  y: 26,
  collides: me => e.remove(me),
})
/* END COIN */

/* BEGIN TILE */
e.add({
  sprite: tile,
  solid: true,
  scale: 4,
  x: 91, 
  y: 204
})
/* END TILE */

e.start();
